					<h1>Демонтаж части фундаментной плиты</h1>
									<p>Объект: Московская область, Переславль-Залесский, Завод.</p>

<p>Задача: демонтировать часть фундаментной плиты и разделить на фрагменты, в непрерывно работающем цеху, с полным отсутствием пыли и грязи вне рабочей зоны.</p>

<p>Для осуществления этого проекта нами был сооружен защитный каркас обтянутый пленкой. Так же была сделана вентиляция.</p>

<p>При резке использовались стенорезные машины HILTI DSTS32, бурильные установки HILTI DD350 и промышленные пылесосы HILTI VCU40.</p>

<p>Этот объем работ был выполнен за 16 часов.</p> 		<div style="clear:both"></div>
